import { Link } from "react-router-dom";

import EventDetailPage from "./EventDetail";

const EVENT_ITEMS = [
  {
    id: "e1",
    title: "Event 1",
  },
  {
    id: "e2",
    title: "Event 2",
  },
  {
    id: "e3",
    title: "Event 3",
  },
  {
    id: "e4",
    title: "Event 4",
  },
];

export default function EventsPage() {
  return (
    <>
      <h1>My Events Page</h1>
      <button>
        <Link to="new">New Event</Link>
      </button>
      <ul>
        {EVENT_ITEMS.map((event) => (
          <li key={event.id}>
            <Link to={event.id}>{event.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
}
